    [],nt"revision_timestamp": "2016-05-31T05:29:56.838360",nt"name": "u-s-climate-normals-product-suite-1981-2010",nt"isopen":
    false,nt"url": null,nt"notes": "The NOAA Climate Normals are a large suite
    of data products that provide users with many tools to understand typical climate
    conditions for thousands of locations across the United States, including the 30-year
    normals, 5, 10, 15, 20-year normals, agricultural normals, and others. For nearly
    100 years, the 30-year NOAA Climate Normals have been a premier NOAA product of
    30-year-averages of meteorological parameters. The 1981-2010 Climate Normals Product
    Suite has been expanded to meet more user needs and requirements spanning many different
    industries, including agriculture, heating and cooling, construction, and others.
    To ensure both quality and completeness, hundreds of NWS stations meeting stringent
    criteria are used, including those from NWS's Cooperative Observer Program (COOP)
    Network, some additional stations are included in the Supplemental Climate Normals
    for 1981-2010.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
